package com.company;

import java.util.ArrayList;
import java.util.HashMap;
import java.util.List;
import java.util.Map;

//https://leetcode-cn.com/problems/find-all-anagrams-in-a-string/
public class FindAnagrams {

    public static void main(String[] args) {
        //int[] arr = {5,2,3};
        //int target = 10;
        String s = "";
        String p = "";
        FindAnagrams obj = new FindAnagrams();
        List<Integer> res = obj.findAnagrams(s, p);

        System.out.println();
    }

    public List<Integer> findAnagrams(String s, String p) {
        List<Integer> res = new ArrayList<>();
        if (s.length() <= p.length()) {
            return res;
        }
        Map<Character, Integer> counter = new HashMap<>();
        Map<Character, Integer> pmap = new HashMap<>();
        for (char t : p.toCharArray()) {
            counter.put(t, 0);
            pmap.put(t,pmap.getOrDefault(t,0)+1);
        }


        //初始化计算
        int start = 0, end = 0, stop = s.length();
        for (; end < p.length(); end++) {
            if (counter.containsKey(s.charAt(end))) {
                int count = counter.get(s.charAt(end)) + 1;
                counter.put(s.charAt(end), count);
            }
        }

        if (judge(counter, pmap)) {
            res.add(start);
        }

        //双指针遍历
        while (end < stop) {
            //左指针移动,移除char at start
            char startchar = s.charAt(start);
            int startcount = counter.getOrDefault(startchar, 0);
            if (startcount > 0) {
                counter.put(startchar, startcount - 1);
            }
            start++;

            //右指针移动,增加char at end
            char endchar = s.charAt(end);
            int endcount = counter.getOrDefault(endchar, 0);
            counter.put(endchar, endcount + 1);
            end++;
            if (judge(counter, pmap)) {
                res.add(start);
            }
        }

        return res;
    }

    private boolean judge(Map<Character, Integer> counter,  Map<Character, Integer> pmap) {
        for (char t : pmap.keySet()) {
            //if (counter.getOrDefault(t, 0) != pmap.get(t)) {  大于128无法判断 Integer == 判断的是内存地址
            if (!counter.getOrDefault(t, 0) .equals(pmap.get(t))) {
                return false;
            }
        }
        return true;
    }
}

